                <ns0:ConceptList>
                    <ns0:Concept code="18170008" codeSystem="2.16.840.1.113883.6.96" codeSystemName="SNOMEDCT" codeSystemVersion="2018-09" displayName="Subsequent nursing facility visit (procedure)"/>
